import logo from "./logo.svg";
import "./App.css";
import ExpenseItem from "./comonents/ExpenseItems";

/*


*/

function App() {
  const expenses = [
    { title: "Car", amount: 214234, date: "1/8/2033" },
    { title: "asdf", amount: 334, date: "12/8/2033" },
    { title: "333", amount: 11, date: "14/12/2033" },
    { title: "Ca111r", amount: 2411, date: "6/8/2033" },
  ];

  const expenseItems = expenses.map((expense, index) => (
    <ExpenseItem
      key={index} // Don't forget to include a unique key when rendering an array of elements
      title={expense.title}
      amount={expense.amount}
      date={expense.date}
    />
  ));

  // altentave way
  // <ExpenseItem>expense= {expenses[index]} </ExpenseItem>
  //and change in the component file {props.title}

  //and can use another way that is by destricating ob
  return <div className="App">{expenseItems}</div>;
}
export default App;
